INSERT INTO `v1_0d95d7b6c007e9c3987b5575e6d12dd9503597925591ebbe2b8c9fdba8f9a7a0` VALUES (3000, "調子が上がって\nきたなっ", 2, 1, 2, "訓練はまだ\nここからですわ", 2, "vo_minigame_1013_icon_1_002_001", "vo_minigame_1013_icon_2_002_001", 1000);
INSERT INTO `v1_0d95d7b6c007e9c3987b5575e6d12dd9503597925591ebbe2b8c9fdba8f9a7a0` VALUES (3000, "ほらほら、\nまだいけるだろ？", 2, 2, 2, "クスクス、悪くない\n流れですわね", 2, "vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", 5000);
INSERT INTO `v1_0d95d7b6c007e9c3987b5575e6d12dd9503597925591ebbe2b8c9fdba8f9a7a0` VALUES (3000, "へへっ、おまえら\nやるじゃねえか！", 2, 3, 3, "すばらしい\n記録ですわ", 2, "vo_minigame_1013_icon_1_004_001", "vo_minigame_1013_icon_2_004_001", 10000);
INSERT INTO `v1_0d95d7b6c007e9c3987b5575e6d12dd9503597925591ebbe2b8c9fdba8f9a7a0` VALUES (3000, "あたしたちはまだ\n止まらねえぜ！", 3, 4, 3, "乗りに乗って\nいますわね", 2, "vo_minigame_1013_icon_1_005_001", "vo_minigame_1013_icon_2_005_001", 10000);
